import React from 'react';
import Particles from 'react-particles';
import particlesConfig from '../particlesConfig';

const ParticlesBackground = () => {
  return (
    <Particles
      params={particlesConfig}
      style={{
        position: 'fixed',
        zIndex: -1,
        top: 0,
        left: 0,
        width: '100%',
        height: '100%',
      }}
    />
  );
};

export default ParticlesBackground;
